import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata"



function App (){
    return(

        <>

        <h1 className="heading_style"> List of top 3 Netflix series in 2022</h1>
        <Card
        //   sname= "Dark"
        //   imgsrc= "https://theglobalcoverage.com/wp-content/uploads/2020/01/Dark.jpg"
        //   title= " https://www.netflix.com/in/"
        //   link= "https://www.netflix.com/in/title/80100172"
        imgsrc={Sdata[0].imgscr}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].links}
        />
        <Card
        sname="extra curricular"
        imgsrc="https://asianwiki.com/images/4/47/Human_Class-KDH.jpg"
        title="https://www.netflix.com/in/" 
        link="https://www.netflix.com/in/title/80990668"
        />
        <Card/>
        </>
    );
}

export default App;
